original_question:
Saddexagalka $ABC$ waa isosceles, oo leh $AB=AC$ iyo joogga $AM=11.$ U qaado in ay jirto dhibic $D$ oo ku taal $\overline{AM}$ oo leh $AD=10$ iyo $\angle BDC=3\angle BAC.$ Hel wareegga saddexagalka $ABC.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

